            </Title> */}
            <Container>
                {productsMen.map((item) => (
                    <Product item={item} key={item.id} />
                ))}
            </Container>
            {/* <Button>
                See More
            </Button> */}
        </ProductsSection>
    )
}

export default MenProducts
